The Role

The RAAF Institute of Aviation Medicine (IAM) is seeking a Data Scientist to join the Aeromedical Analysis and Decision Support (AADS) Team. 

This offers the opportunity to support Defence aviation through the production of aeromedical guidance tailored to provide aviation safety stakeholders with information to support decision making in areas related to human performance, aeromedical hazards, and aviation safety.

Working in an organisation that values innovation, you collaborate with uniformed and civilian aviation medicine and human factors specialists to provide timely and appropriate evidence-based guidance. 

In your role as Data Scientist, you will form part of a small close-knit team to perform data processing and analysis to contribute to team outputs, and within scope of expertise undertake data collection and analysis, and written advice for directed tasking, encompassing; psychological, human factors, physical, and physiological dimensions of the aviation domain related to human performance, safety, and operational capability.

About our Team

Institute of Aviation Medicine is the Australian Defence Force centre of excellence in aviation medicine and human factors, dedicated to providing specialist guidance and expert advice across the three services as follows:

Aviation medicine and human factors;
Human-systems integration and ergonomics; 
Interface between aircrew and life-support systems;
Hazard analysis and advice in assessment/management of risks arising from human physiology, ergonomics, anthropometry, medical factors, or human performance limitations; 
Assessing likelihood and consequence of medical hazards in aircrew and controllers, and working with risk-holders within a harmonised Defence risk-management system;
Applying a structured approach to problem definition and providing evidence-based recommendations to support decision-makers. 

This exciting and rare opportunity to grow your career in a supportive environment, will allow you to be integral to a team significantly contributing to Defence aviation capability and risk management.

Our Ideal Candidate

To succeed in the role, you will have the demonstrated ability to:

Plan, provide advice, and deliver critical complex review activities, 
Manage concurrent activities with competing priorities within the direction established by Institute of Aviation Medicine;
Demonstrate effective verbal and written communication skills which enable you to positively liaise with internal and external stakeholders as required;
Manage workflows and resources, prepare work area and team plans detailing measurable milestones and expected outcomes within specified deadlines;
Apply the principles of problem definition and scientific method as the foundation of a problem-solving framework, and the ability to analyse and interpret data to develop evidence-based, meaningful and relevant recommendations;
Apply scientific principles to problem definition, data analysis, and generation of evidence-based recommendations;
Proficiently use advanced features of Microsoft Software and statistical analysis software.

Application Closing Date: Sunday 1 February 2026

